  const products = useSelector(({ products }) => products)

  return (
    <Container>
       {products.length === 0 ?
          <div>
            <h1>Sua sacola est√° vazia</h1>
              <p>Adicione itens</p>
          </div>
       : <>
            {products.map((product) => (
              <Product key={product.id} product={product} />
            ))}
          </>
      }
    </Container>
  );
};

export default Products
